using System.Web;
using System;
using System.Data.SqlClient;
using SuperSecureBank;
using SuperSecureBank.Account;
namespace SuperSecureBank.Account
{
	public class Login : System.Web.UI.Page
	{
		protected global::System.Web.UI.WebControls.Literal FailureText;
		protected global::System.Web.UI.WebControls.TextBox Password;
		protected global::System.Web.UI.WebControls.TextBox UserName;
		protected void LoginButton_Click(object sender, EventArgs e)
		{
			try {
				if (UserMgmt.UserExists(UserName.Text)) {
					Int64 userID = UserMgmt.CheckUser(UserName.Text, Password.Text);
					if (0 != userID) {
						Response.Cookies[Settings.Default.SessionCookieKey].Value = UserMgmt.CreateSession(userID).ToString();
						string continueUrl = Request.QueryString["ReturnUrl"];
						if (String.IsNullOrEmpty(continueUrl)) {
							continueUrl = "~/";
						}
						Response.Redirect(continueUrl);
					} else {
						FailureText.Text = string.Format("Sorry {0}, that's not the password we have stored in the system. Please try again.", CleanUsername(UserName.Text));
					}
				} else {
					FailureText.Text = string.Format("Sorry, the username {0} doesn't exist in the system", CleanUsername(UserName.Text));
				}
			} catch (Exception ex) {
				ErrorLogging.AddException("Error in Register", ex);
				FailureText.Text = ex.ToString();
			}
		}
		private string CleanUsername(string p)
		{
			p = p.Replace("<script>", "");
			return p;
		}
	}
}
namespace SuperSecureBank
{
	public class UserMgmt
	{
		public static bool UserExists(string username)
		{
			Int64 userID = 0;
			try {
				string getUserID = "SELECT userID FROM Users WHERE userName = '{0}'";
				using (SqlConnection conn = new SqlConnection(ConfigurationManager.ConnectionStrings["ssbcon"].ConnectionString)) {
					conn.Open();
					getUserID = String.Format(getUserID, username);
					SqlCommand command = new SqlCommand(getUserID, conn);
					SqlDataReader reader = command.ExecuteReader();
					while (reader.Read()) {
						userID = reader.GetInt64(0);
					}
				}
			} catch {
				throw;
			}
			return userID != 0;
		}
		public static Int64 CheckUser(string username, string password)
		{
			Int64 userID = 0;
			try {
				string getUserID = "SELECT userID FROM Users WHERE userName = '{0}' AND password = '{1}'";
				using (SqlConnection conn = new SqlConnection(ConfigurationManager.ConnectionStrings["ssbcon"].ConnectionString)) {
					conn.Open();
					getUserID = String.Format(getUserID, username, password);
					SqlCommand command = new SqlCommand(getUserID, conn);
					SqlDataReader reader = command.ExecuteReader();
					while (reader.Read()) {
						userID = reader.GetInt64(0);
					}
				}
			} catch {
				throw;
			}
			return userID;
		}
		public static Int64 CreateSession(Int64 userID)
		{
			Int64 sessionID = 0;
			try {
				sessionID = SessionIDSingleton.Instance.NextSessionID;
				string insertSession = "INSERT INTO sessions values ({0}, {1})";
				SqlConnection conn = new SqlConnection(ConfigurationManager.ConnectionStrings["ssbcon"].ConnectionString);
				conn.Open();
				insertSession = String.Format(insertSession, userID, sessionID);
				SqlCommand command = new SqlCommand(insertSession, conn);
				command.ExecuteNonQuery();
				conn.Close();
			} catch {
				throw;
			}
			return sessionID;
		}
	}
	public class ErrorLogging
	{
		public static void AddException(string errorText, Exception ex)
		{
			string insertError = "INSERT INTO ErrorLog values ('{0}', '{1}', '{2}')";
			SqlConnection conn = new SqlConnection(ConfigurationManager.ConnectionStrings["ssbcon"].ConnectionString);
			conn.Open();
			insertError = String.Format(insertError, DateTime.Now, cleanForSQL(errorText), BuildExceptionText(ex));
			SqlCommand command = new SqlCommand(insertError, conn);
			command.ExecuteNonQuery();
			conn.Close();
		}
		public static string cleanForSQL(string foo)
		{
			if (null != foo) {
				return foo.Replace("'", "''");
			} else
				return "";
		}
		private static string BuildExceptionText(Exception ex)
		{
			string exceptionText = "<h3>{0}</h3>More Info: {1}<br/><h4>Stack</h4><br/><pre><code>{2}</code></pre>";
			return string.Format(exceptionText, cleanForSQL(ex.Message), cleanForSQL(ex.HelpLink), cleanForSQL(ex.StackTrace.Replace("\r\n", "<br>").Replace("\t", "&nbsp;&nbsp;&nbsp;&nbsp;")));
		}
	}
	public class SessionIDSingleton
	{
		public Int64 NextSessionID {
			get {
				currentID = new Random((int)currentID).Next(Int32.MaxValue);
				return currentID;
			}
		}
		public static SessionIDSingleton Instance {
			get { return instance; }
		}
	}
}
